import React from "react";
import Testimonial from "../../Testimonial";

const TestimonialSegment: React.FC = ({ children }) => (
    <React.Fragment>
        <div className="p-5 border-blue-500  border-2 overflow-hidden flex flex-row items-start justify-center w-screen h-screen  pt-4 mb-16 bg-gray-50 lg:bg-white lg:mb-20 lg:w-full lg:h-96 lg:pt-0">
            <div className="border-red-500 border-2 z-50 top-0 w-full h-full flex flex-col items-center justify-between font-sans min-h-96  lg:bg-hero lg:bg-cover">
                <div className="border-green-500 border-2 relative w-full h-full pl-10 pr-10 z-50 flex flex-col items-center justify-between lg:space-x-8 pt-7 lg:pt-0 lg:flex-row lg:justify-between lg:w-90">

                    <Testimonial text={"first testimonial"} rating={5} />
                </div>

            </div>
        </div>

    </React.Fragment>
);

export default TestimonialSegment;
